    "Images in the folder '/usericons' can be used as icons for devices.": {"en": "Images in the folder '/usericons' can be used as icons for devices.", "de": "Bilder im Verzeichnis '/usericons' können als Icons für Geräte verwendet werden.", "ru": "Изображения в папке «/ usericons» можно использовать в качестве значков для устройств.", "pt": "Imagens na pasta '/ usericons' podem ser usadas como ícones para dispositivos.", "nl": "Afbeeldingen in de map '/ usericons' kunnen worden gebruikt als pictogrammen voor apparaten.", "fr": "Les images du dossier '/ usericons' peuvent être utilisées comme icônes pour les appareils.", "it": "Le immagini nella cartella '/ usericons' possono essere usate come icone per i dispositivi.", "es": "Las imágenes en la carpeta '/ usericons' pueden usarse como iconos para dispositivos.", "pl": "Obrazy w folderze „/ usericons” mogą być używane jako ikony urządzeń.", "zh-cn": "“/ usericons”文件夹中的图像可用作设备的图标。"},
    "Images in the folder '/usersymbols' can be used as symbols for states.": {"en": "Images in the folder '/usersymbols' can be used as symbols for states.", "de": "Bilder im Verzeichnis '/usersymbols' können als Symbole für States verwendet werden.", "ru": "Изображения в папке '/ usersymbols' могут использоваться как символы состояний.", "pt": "As imagens na pasta '/ usersymbols' podem ser usadas como símbolos de estados.", "nl": "Afbeeldingen in de map '/ gebruikerssymbolen' kunnen worden gebruikt als symbolen voor staten.", "fr": "Les images du dossier '/ usersymbols' peuvent être utilisées comme symboles pour les états.", "it": "Le immagini nella cartella \"/ usersymbols\" possono essere utilizzate come simboli per gli stati.", "es": "Las imágenes de la carpeta '/ usersymbols' se pueden utilizar como símbolos de estados.", "pl": "Obrazy w folderze „/ usersymbols” mogą być używane jako symbole stanów.", "zh-cn": "文件夹“ / usersymbols”中的图像可用作状态符号。"},
