    "The first Toolbar-Entry will be your 'Home-View' with will be loaded at start.": {"en": "The first Toolbar-Entry will be your 'Home-View' with will be loaded at start.", "de": "Der erste Toolbar-Eintrag wird Ihre \"Home-Ansicht\", die beim Start geladen wird.", "ru": "Первая панель инструментов-запись будет свой дом-вид С будет загружаться при старте.", "pt": "A primeira barra de Ferramentas-Entrada vai ser a sua \"Casa-Vista' com a vontade de ser carregado no início.", "nl": "De eerste Werkbalk-Invoer zal uw 'Home-View' wordt geladen bij het starten.", "fr": "La première Barre d'outils-Entrée de votre Maison-Vue \" avec sera chargé au départ.", "it": "La prima Barra degli strumenti-Voce di essere la vostra Casa con Vista' con la volontà di essere caricati all'avvio.", "es": "La primera Barra de herramientas de Entrada va a ser su Hogar-Ver \" con la voluntad de ser cargado en el arranque.", "pl": "Pierwszy pasek narzędzi-nagrywanie będzie swój dom-widok Z będzie się uruchamiać przy starcie.", "zh-cn": "第一个导航栏条目将作为您UI界面的默认页面。"},
    "The folder '/userwidgets' allows uploading of html, css and js files to create widgets, which may be displayed as BACKGROUND_URL of a tile.": {"en": "The folder '/userwidgets' allows uploading of html, css and js files to create widgets, which may be displayed as BACKGROUND_URL of a tile.", "de": "In den Ordner '/userwidgets' können html, css und js dateien hochgeladen werden, um widgets zu erstellen, die als BACKGROUND_URL von Kacheln angezeigt werden können.", "ru": "Папка '/ userwidgets' позволяет загружать файлы html, css и js для создания виджетов, которые могут отображаться как BACKGROUND_URL плитки.", "pt": "A pasta '/ userwidgets' permite o upload de arquivos html, css e js para criar widgets, que podem ser exibidos como BACKGROUND_URL de um bloco.", "nl": "Met de map '/ userwidgets' kunnen html-, css- en js-bestanden worden geüpload om widgets te maken, die kunnen worden weergegeven als BACKGROUND_URL van een tegel.", "fr": "Le dossier '/ userwidgets' permet de télécharger des fichiers html, css et js pour créer des widgets, qui peuvent être affichés comme BACKGROUND_URL d'une tuile.", "it": "La cartella \"/ userwidgets\" consente il caricamento di file html, css e js per creare widget, che possono essere visualizzati come BACKGROUND_URL di un riquadro.", "es": "La carpeta '/ userwidgets' permite cargar archivos html, css y js para crear widgets, que pueden mostrarse como BACKGROUND_URL de un mosaico.", "pl": "Folder „/ userwidgets” umożliwia przesyłanie plików html, css i js w celu tworzenia widżetów, które mogą być wyświetlane jako BACKGROUND_URL kafelka.", "zh-cn": "文件夹“ / userwidgets”允许上载html，css和js文件以创建小部件，这些小部件可以显示为图块的Background_URL。"},
    "The free builtin demo-wallpapers are from www.pexels.com.": {"en": "The free builtin demo-wallpapers are from www.pexels.com.", "de": "Die kostenlosen Demo-Bilder stammen von www.pexels.com.", "ru": "Бесплатные встроенные демо-обои из www.pexels.com.", "pt": "O livre builtin demo-papéis de parede são de www.pexels.com.", "nl": "De gratis ingebouwde demo-wallpapers zijn van www.pexels.com.", "fr": "La libre builtin démo-fonds d'écran sont de www.pexels.com.", "it": "Il libero builtin demo-sfondi sono da www.pexels.com.", "es": "La libre builtin demo-fondos de pantalla son de www.pexels.com.", "pl": "Darmowe wbudowane demo tapety z www.pexels.com.", "zh-cn": "适配器免费的内建壁纸来自于www.pexels.com。"},
