    "The selected Device will be copied to View ": { "en": "The selected Device will be copied to View ",     "de": "Das Gerät wird in folgende Ansicht kopiert: ",    "ru": "Выбранное устройство будет скопировано для просмотра", "pt": "O dispositivo selecionado será copiado para View", "nl": "Het geselecteerde apparaat wordt gekopieerd naar Weergave", "fr": "Le périphérique sélectionné sera copié dans View", "it": "Il dispositivo selezionato verrà copiato in Visualizza", "es": "El dispositivo seleccionado se copiará a la vista", "pl": "Wybrane urządzenie zostanie skopiowane do widoku", "zh-cn": "选定的设备将复制到View"},
    "The uploaded images have been moved to a new location. This is only done once and allowes automatic backup of these files by iobroker. Please reload this site and save the settings, so all filenames can be updated!": {"en": "The uploaded images have been moved to a new location. This is only done once and allowes automatic backup of these files by iobroker. Please reload this site and save the settings, so all filenames can be updated!", "de": "Die hochgeladenen Bilder wurden in ein neues Verzeichnis verschoben. Dies wird nur einmalig durchgeführt und dient dazu, die Dateien über die Backup-Funktion von ioBroker sichern zu können. Bitte laden Sie diese Seite neu und speichern Sie dann die Einstellungen, dabei werden die Dateinamen der Bilder automatisch angepasst!", "ru": "Загруженные изображения были перемещены в новое место. ", "pt": "As imagens enviadas foram movidas para um novo local. ", "nl": "De geüploade afbeeldingen zijn verplaatst naar een nieuwe locatie. ", "fr": "Les images téléchargées ont été déplacées vers un nouvel emplacement. ", "it": "Le immagini caricate sono state spostate in una nuova posizione. ", "es": "Las imágenes cargadas se han movido a una nueva ubicación. ", "pl": "Przesłane obrazy zostały przeniesione do nowej lokalizacji. ", "zh-cn": "上传的图像已移至新位置。"},
